Information
------------------------------

Mortality and death have always fascinated humankind. Civilizations from all over the world have practiced mummification as a means of preserving life after death--a ritual which captures the imagination of scientists, artists, and public alike. 
For nearly everyone the words &quot;pyramids&quot; and &quot;mummies&quot; evoke images of ancient Egypt. Yet those intriguing cultural artifacts are by no means unique to the Land of the Pharoahs. As this collection vividly demonstrates, they are found around the world, including the Americas. Indeed, the oldest mummies in the world, and some of the most sophisticated anywhere, come not from the Nile Valley but from the Atacama Desert in Chile. Mummies have always been with us, and today we turn to them with ever more advanced and refined methods and learning their deep secrets.

1)  Mystery of the Black Mummy 
Five thousand four hundred years ago, a two-year-old black boy had been buried under a rock shelter. His body was carefully eviscerated and prepared for mummification, then lovingly wrapped in antelope skin. He was the oldest mummy ever found in Africa and until he was unearthed, everyone thought the Egyptians had invented mummification in Africa.
After discovering the oldest mummy ever found in Africa, a group of archaeologists set out quest that spanned almost 50 years. They searched throughout the continent for clues about who could have buried it--and why it was found 1,000 miles away from Egypt, the civilization previously thought to be the first to mummify their dead. Their trail lead them to a long lost African culture that had influenced the development of ancient Egypt in ways which no one had ever thought possible.

